BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Team_Locations" (
	"Team_ID"	TEXT UNIQUE,
	"Season"	INTEGER,
	"AffiliateLeague"	TEXT,
	"Affiliate"	TEXT,
	"League"	TEXT,
	"TeamName"	TEXT,
	"Classification"	TEXT,
	"Category"	TEXT,
	"Location_ID"	TEXT,
	"City"	TEXT,
	"State"	TEXT,
	"County"	TEXT,
	PRIMARY KEY("Team_ID")
);
CREATE TABLE IF NOT EXISTS "Player_PoB" (
	"id_person"	INTEGER UNIQUE,
	"DoB"	INTEGER,
	"PoB_ID"	TEXT,
	"City"	TEXT,
	"State"	TEXT,
	"Country"	TEXT,
	"Region"	TEXT,
	"Group"	TEXT,
	"Lat"	REAL,
	"Long"	REAL,
	PRIMARY KEY("id_person")
);
CREATE TABLE IF NOT EXISTS "Combined_Transactions" (
	"id_person"	INTEGER,
	"team_id"	TEXT,
	FOREIGN KEY("id_person") REFERENCES "Player_PoB"("id_person")
);
COMMIT;
